export default (state, action) => {
	console.log(action.type, action.payload)
	switch (action.type) {
		case 'INIT_SCHEDULE':
      return {schedule: {'departments': []}, textError: '', loadingFlag: false};

		case 'LOAD_SCHEDULE':
			return {schedule: {'departments': []}, textError: '', loadingFlag: true};

		case 'LOAD_SCHEDULE_FAILURE':
			return {schedule: {'departments': []}, textError: action.payload, loadingFlag: false};

		case 'LOAD_SCHEDULE_SUCCESS':
			return {schedule: action.payload, textError: '', loadingFlag: false};

		case 'RESET_SCHEDULE':
			return {schedule: {'departments': []}, textError: '', loadingFlag: false};

		default:
      return {...state, schedule: {'departments': []}, textError: '', loadingFlag: false};
	}
};
